webpackJsonp([57809903730360],{2464:function(t,e){t.exports={data:{markdownRemark:{html:'<p><strong>â™¡</strong></p>\n<p>Today I went to Musashino village in Kazo city to play. Today, her H and her older sister are together!</p>\n<p>It was one and a half hours by car and it was quite far. H was weaker to the car than me, I got off on the way and was returning at the end of the road. It seems I got better after I got juice.</p>\n<p>Originally it was a little athletic like the name "Musashino village", but I was watching it, but when I opened the lid I was surprised at a proper amusement park.</p>\n<p>We enjoyed the attraction, and the lunch that day was the best.</p>\n<p>But I have two heartbreaks. One thing I wanted to play more. And the other thing is that I wanted to go with her alone.</p>',frontmatter:{cover:null,date:"1990-11-23T22:00:00+09:00",strDate:"1990/11/23",title:"diary"}}},pathContext:{path:"/en/blog/1990/11/23-diary/",langKey:"en"}}}});
